import Modal from "../../hom";

export default function Navbar() {
    return (
        <body id="Border">

            <nav id="container">
                <img id="image"></img>
                <li id="item">
                    <button class="coolBeans">
                        Sign In
                    </button>
                    <button class="coolBeans">
                        Register
                    </button>
                </li>

            </nav>
        </body>


    );
}
